import React from 'react';
import { Button, ToggleButton, Tooltip } from '@mui/material';


import { DarkModeOutlined, LightModeOutlined, GitHub } from '@mui/icons-material';


function Navbar() {
  return (
    <nav class="nav-bar">
      <div class="nav-bar-content">
        <div class="nav-bar-left">
          <Button class="nav-bar-button-left">Home</Button>
          <Button class="nav-bar-button-left">Favourites</Button>
        </div>
        <div class="nav-bar-right">
          <Tooltip title="Turn on light mode">
            <Button class="" variant="outlined">
              <DarkModeOutlined/>
            </Button>
          </Tooltip>

          <Tooltip title="GitHub repository">
            <Button href="https://github.com/mui" class="" variant="outlined">
              <GitHub/>
            </Button>
          </Tooltip>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
